import { Navigate, useRoutes } from "react-router-dom";
import LandingPage from "./pages/LandingPage";
import Checkout from "./pages/Checkout";

export default function Router() {
  return useRoutes([
    //{
    //path: 'login',
    //element: <Login />,
    //},
    //{
    //path: 'register',
    //element: <Register />,
    //},

    {
      path: "/LandingPage",
      element: <LandingPage />,
      children: [{ path: "Landingpage", element: <LandingPage /> }],
    },
    {
      path: "/Checkout",
      element: <Checkout />,
    },
  ]);
}
